INSERT INTO `email_templates` (`id`, `date_entered`, `date_modified`, `modified_user_id`, `created_by`, `published`, `name`, `description`, `subject`, `body`, `body_html`, `deleted`, `assigned_user_id`, `text_only`, `type`) VALUES
('5aff5e5c-86c1-cf60-ecba-5f37f1992dc0',	'2020-08-15 14:30:41',	'2020-08-15 14:30:41',	'1',	'1',	'off',	'System-generated password email',	'This template is used when the System Administrator sends a new password to a user.',	'New account information',	'\nHere is your account username and temporary password:\nUsername : $contact_user_user_name\nPassword : $contact_user_user_hash\n\n$config_site_url\n\nAfter you log in using the above password, you may be required to reset the password to one of your own choice.',	'<div><table width=\"550\"><tbody><tr><td><p>Here is your account username and temporary password:</p><p>Username : $contact_user_user_name </p><p>Password : $contact_user_user_hash </p><br /><p>$config_site_url</p><br /><p>After you log in using the above password, you may be required to reset the password to one of your own choice.</p>   </td>         </tr><tr><td></td>         </tr></tbody></table></div>',	0,	NULL,	0,	'system'),
('5e8066f1-1d4d-13d5-3a4c-5f37f1797aa7',	'2020-08-15 14:30:41',	'2020-08-15 14:30:41',	'1',	'1',	'off',	'Forgot Password email',	'This template is used to send a user a link to click to reset the user\'s account password.',	'Reset your account password',	'\nYou recently requested on $contact_user_pwd_last_changed to be able to reset your account password.\n\nClick on the link below to reset your password:\n\n$contact_user_link_guid',	'<div><table width=\"550\"><tbody><tr><td><p>You recently requested on $contact_user_pwd_last_changed to be able to reset your account password. </p><p>Click on the link below to reset your password:</p><p> $contact_user_link_guid </p>  </td>         </tr><tr><td></td>         </tr></tbody></table></div>',	0,	NULL,	0,	'system'),
('620d0d46-aab1-0c4f-8edd-5f37f1006a4a',	'2020-08-15 14:30:41',	'2020-08-15 14:30:41',	'1',	'1',	'off',	'Two Factor Authentication email',	'This template is used to send a user a code for Two Factor Authentication.',	'Two Factor Authentication Code',	'Two Factor Authentication code is $code.',	'<div><table width=\"550\"><tbody><tr><td><p>Two Factor Authentication code is <b>$code</b>.</p>  </td>         </tr><tr><td></td>         </tr></tbody></table></div>',	0,	NULL,	0,	'system'),
('74fa8c8c-8414-0506-fc18-5f37f172ae8c',	'2020-08-15 14:30:41',	'2020-08-15 14:30:41',	'1',	'1',	'off',	'Confirmed Opt In',	'Email template to send to a contact to confirm they have opted in.',	'Confirm Opt In',	'Hi $contact_first_name $contact_last_name, \\n Please confirm that you have opted in by selecting the following link: $sugarurl/index.php?entryPoint=ConfirmOptIn&from=$emailaddress_email_address',	'<p>Hi $contact_first_name $contact_last_name,</p>\n             <p>\n                Please confirm that you have opted in by selecting the following link:\n                <a href=\"$sugarurl/index.php?entryPoint=ConfirmOptIn&from=$emailaddress_confirm_opt_in_token\">Opt In</a>\n             </p>',	0,	NULL,	NULL,	'system'),
('94dadba1-2884-8518-12fa-5f37f1c00fe7',	'2020-08-15 14:30:41',	'2020-08-15 14:30:41',	'1',	'1',	'off',	'Case Closure',	'Template for informing a contact that their case has been closed.',	'$acase_name [CASE:$acase_case_number] closed',	'Hi $contact_first_name $contact_last_name,\n\n					   Your case $acase_name (# $acase_case_number) has been closed on $acase_date_entered\n					   Status:				$acase_status\n					   Reference:			$acase_case_number\n					   Resolution:			$acase_resolution',	'<p>Hi $contact_first_name $contact_last_name,</p>\n					    <p>Your case$acase_name (# $acase_case_number) has been closed on $acase_date_entered</p>\n					    <table border=\"0\"><tbody><tr><td>Status</td><td>$acase_status</td></tr><tr><td>Reference</td><td>$acase_case_number</td></tr><tr><td>Resolution</td><td>$acase_resolution</td></tr></tbody></table>',	0,	NULL,	NULL,	'system'),
('98c41d33-86c0-5f14-a47a-5f37f167aeab',	'2020-08-15 14:30:41',	'2020-08-15 14:30:41',	'1',	'1',	'off',	'Joomla Account Creation',	'Template used when informing a contact that they\'ve been given an account on the joomla portal.',	'Support Portal Account Created',	'Hi $contact_name,\n					   An account has been created for you at $portal_address.\n					   You may login using this email address and the password $joomla_pass',	'<p>Hi $contact_name,</p>\n					    <p>An account has been created for you at <a href=\"$portal_address\">$portal_address</a>.</p>\n					    <p>You may login using this email address and the password $joomla_pass</p>',	0,	NULL,	NULL,	'system'),
('9c73dedf-40f7-4726-b704-5f37f1736054',	'2020-08-15 14:30:41',	'2020-08-15 14:30:41',	'1',	'1',	'off',	'Case Creation',	'Template to send to a contact when a case is received from them.',	'$acase_name [CASE:$acase_case_number]',	'Hi $contact_first_name $contact_last_name,\n\n					   We\'ve received your case $acase_name (# $acase_case_number) on $acase_date_entered\n					   Status:		$acase_status\n					   Reference:	$acase_case_number\n					   Description:	$acase_description',	'<p>Hi $contact_first_name $contact_last_name,</p>\n					    <p>We\'ve received your case$acase_name (# $acase_case_number) on $acase_date_entered</p>\n					    <table border=\"0\"><tbody><tr><td>Status</td><td>$acase_status</td></tr><tr><td>Reference</td><td>$acase_case_number</td></tr><tr><td>Description</td><td>$acase_description</td></tr></tbody></table>',	0,	NULL,	NULL,	'system'),
('a8018ebc-43f9-ccd7-927f-5f37f1e99c90',	'2020-08-15 14:30:41',	'2020-08-15 14:30:41',	'1',	'1',	'off',	'Contact Case Update',	'Template to send to a contact when their case is updated.',	'$acase_name update [CASE:$acase_case_number]',	'Hi $user_first_name $user_last_name,\n\n					   You\'ve had an update to your case $acase_name (# $acase_case_number) on $aop_case_updates_date_entered:\n					       $contact_first_name $contact_last_name, said:\n					               $aop_case_updates_description',	'<p>Hi $contact_first_name $contact_last_name,</p>\n					    <p></p>\n					    <p>You\'ve had an update to your case$acase_name (# $acase_case_number) on $aop_case_updates_date_entered:</p>\n					    <p><strong>$user_first_name $user_last_name said:</strong></p>\n					    <p style=\"padding-left:30px;\">$aop_case_updates_description</p>',	0,	NULL,	NULL,	'system'),
('ac981ce7-9fb5-447e-b426-5f37f1b903c0',	'2020-08-15 14:30:41',	'2020-08-15 14:30:41',	'1',	'1',	'off',	'User Case Update',	'Email template to send to a SuiteCRM user when their case is updated.',	'$acase_name (# $acase_case_number) update',	'Hi $user_first_name $user_last_name,\n\n					   You\'ve had an update to your case $acase_name (# $acase_case_number) on $aop_case_updates_date_entered:\n					       $contact_first_name $contact_last_name, said:\n					               $aop_case_updates_description\n                        You may review this Case at:\n                            $sugarurl/index.php?module=Cases&action=DetailView&record=$acase_id;',	'<p>Hi $user_first_name $user_last_name,</p>\n					     <p></p>\n					     <p>You\'ve had an update to your case$acase_name (# $acase_case_number) on $aop_case_updates_date_entered:</p>\n					     <p><strong>$contact_first_name $contact_last_name, said:</strong></p>\n					     <p style=\"padding-left:30px;\">$aop_case_updates_description</p>\n					     <p>You may review this Case at: $sugarurl/index.php?module=Cases&action=DetailView&record=$acase_id;</p>',	0,	NULL,	NULL,	'system'),
('b80ebf8e-fc74-d577-76c1-5f37f1216066',	'2013-05-24 14:31:45',	'2020-08-15 14:30:41',	'1',	'1',	'off',	'Event Invite Template',	'Default event invite template.',	'You have been invited to $fp_events_name',	'Dear $contact_name,\nYou have been invited to $fp_events_name on $fp_events_date_start to $fp_events_date_end\n$fp_events_description\nYours Sincerely,\n',	'\n<p>Dear $contact_name,</p>\n<p>You have been invited to $fp_events_name on $fp_events_date_start to $fp_events_date_end</p>\n<p>$fp_events_description</p>\n<p>If you would like to accept this invititation please click accept.</p>\n<p>$fp_events_link or $fp_events_link_declined</p>\n<p>Yours Sincerely,</p>\n',	0,	NULL,	NULL,	'system')
